import { Component, OnInit } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import {BucketService} from "../objects/services";
@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],
})
export class AppComponent implements OnInit{
  title = 'angular';

  buckets: string[]=[];
  bucketName = '';

  constructor(private bucketService: BucketService) {}

  listBuckets() {
    this.http.get('http://localhost:8080/listBuckets').subscribe(response => {
      console.log(response);
    });
  }
  createBucket() {
    console.log('Creating bucket:', this.bucketName);
    this.bucketService.createBucket(this.bucketName).subscribe(
      (response: any) => {
        console.log(response);
      },
      (error) => {
        console.error(error);
      }
    );
  }

  deleteBucket() {
    console.log('Deleting bucket:', this.bucketName);
    this.bucketService.deleteBucket(this.bucketName).subscribe(
      (response: any) => {
        console.log(response);
      },
      (error) => {
        console.error(error);
      }
    );
  }
}

<ul>
  <li *ngFor="let bucket of buckets">{{ bucket }}</li>
</ul>

<input [(ngModel)]="bucketName" placeholder="Bucket name" />
<button (click)="createBucket()">Create bucket</button>
<button (click)="deleteBucket()">Delete bucket</button>
